import React, { FunctionComponent, useState } from "react";
import Pokemon from "./models/pokemon";
import POKEMONS from "./models/mock-pokemon";

const App: FunctionComponent = () => {
  const [pokemons, setPokemons] = useState<Array<Pokemon>>(POKEMONS);

  return (
    <div>
      <h1>Pokédex</h1>
      <p>Il y a {pokemons.length} Pokémons dans mon application !</p>
    </div>
  );
};

export default App;
